e":"https://ssl-static.libsyn.com/p/assets/4/5/4/f/454f0bcb7857219e/One_on_One_version_02_3.png"},{"id":"bobharrington","title":"The Bob Harrington Show","url":"https://feeds.libsyn.com/116736/rss","author":"Medscape","description":"The Bob Harrington Show is a podcast series of thoughtful interviews and discussions on topics at the core of cardiology and the practice of medicine.","image":"https://ssl-static.libsyn.com/p/assets/d/1/6/8/d16842bf84879bf8/Bob_Harrington_version_02.png"},{"id":"twicardiology","title":"This Week in Cardiology","url":"https://feeds.libsyn.com/116734/rss","author":"Medscape","description":"This podcast delivers Dr. John Mandrola’s summary and perspective on top news of the week that cardiologists can’t miss.","image":"https://ssl-static.libsyn.com/p/assets/2/1/f/9/21f9888d5a59bd0c/Cardio_version_02_1.png"},{"id":"100","title":"Hospital and Internal Medicine Podcast","url":"https://feed.podbean.com/hospitalmedicine/feed.xml","author":"Gil Porat, M.D., FACP, CPT","description":"Intended for the medical professional who enjoys learning for the sake of it. Dr. Porat is a practicing Colorado Hospitalist and Board Certified in Internal Medicine.","image":"https://pbcdn1.podbean.com/imglogo/image-logo/525552/IMG_1904-2.jpg"},{"id":"102","title":"The #HCBiz Show!","url":"https://feeds.libsyn.com/96394/rss","author":"Don Lee and Shahid Shah","description":"A practical podcast on the business of healthcare w/ hosts Don Lee and Shahid Shah. The premise behind #HCBiz is that we can't \"just innovate\". Sure, you may have a great idea, an all-star team and execute flawlessly, but if you don't understand the complex dynamics of the healthcare business you'll never get traction. We'll identify the issues that impede change, explain why they exist and find ways to work with them, through them, or around them. In short, we'll help you create space for innovation in healthcare through technology (HealthIT | HIT | Digital Health) and workflow. We'll also explore health policy, administration and the psychology behind it all. Finally, we help you align your ideas to business incentives, market them to healthcare leaders and get the sale.Check out all of our podcasts, videos and blog posts here: http://thehcbiz.com/. Produced by Glide Health IT LLC in partnership with Netspective Media.","image":"https://ssl-static.libsyn.com/p/assets/9/8/b/d/98bd932962566cfa/itune-Cover-art-yellow-1400x1400-v2.jpg"},{"id":"103","title":"Dermasphere - The Dermatology Podcast","url":"https://anchor.fm/s/866b34c/podcast/rss","author":"Luke Johnson","description":"For dermatology practitioners, Dermasphere covers the most important updates from the latest articles and research in the field. Maybe you don’t have time to read the journals—but we hope you have time to listen to a podcast about them!","image":"https://d3t3ozftmdmh3i.cloudfront.net/production/podcast_uploaded_nologo/1309483/1309483-1548625367435-ff64d8d897bb9.jpg"},{"id":"107","title":"RheumNow Podcast","url":"https://feed.podbean.com/rheumnow/feed.xml","author":"Dr. Cush","description":"Dr Jack Cush reviews the news, journal reports and FDA approvals","image":"https://pbcdn1.podbean.com/imglogo/image-logo/3681760/avatars-WU0yPZs9aq9zc0Tz-z65PkA-original.jpg"},{"id":"108","title":"Beyond The Scope","url":"https://anchor.fm/s/16e0bd00/podcast/rss","author":"Michele Neskey, PA-C","description":"The Reality of A Career in Medicine Support this podcast","image":"https://d3t3ozftmdmh3i.cloudfront.net/production/podcast_uploaded_nologo/3738272/3738272-1587235077954-b1682f56dac56.jpg"},{"id":"101","title":"The Short Coat","url":"https://theshortcoat.com/feed/podcast","author":"Dave Etler and the Students of the University of Iowa Carver College of Medicine","description":"The HONEST guide to medical school, featuring real students from the University of Iowa Carver College of Medicine&#8211;skip this show if you&#8217;d rather not know (and hate laughter)!","image":"http://theshortcoat.com/wp-content/uploads/powerpress/Short-coat-logo-itunes-artwork-2017-721.png"},{"id":"109","title":"Doctors and Litigation: The L Word","url":"https://feed.podbean.com/thelword/feed.xml","author":"Gita Pensa MD","description":"The majority of physicians will be sued during their career, yet the topic is largely taboo. This podcast for physicians discusses malpractice litigation and litigation stress, with the voices of doctors who have been through it. Music by @BenJamin Banger. Learn more about creator Gita Pensa M.D. at doctorsandlitigation.com Also available on Apple Podcasts and Spotify","image":"https://pbcdn1.podbean.com/imglogo/image-logo/3921769/L_WORD_TEMPLATE_4_.png"},{"id":"110","title":"Becker’s Healthcare Podcast","url":"https://feeds.blubrry.com/feeds/beckershealthcarepodcast.xml","author":"Becker's Healthcare","description":"Becker's Healthcare Podcast is an exciting new podcast from Becker's Healthcare which features interviews and conversations with the latest in thought leadership in the healthcare industry.","image":"https://assets.blubrry.com/coverart/orig/733033-534490.jpg"},{"id":"111","title":"Becker's Dental + DSO Review Podcast","url":"https://feeds.blubrry.com/feeds/beckersdentaldsopodcast.xml","author":"Becker's Healthcare","description":"Join our Becker's Healthcare team as we interview a variety or leaders across the dental and DSO space to learn best practices, share challenges and exchange ideas. Send future podcast guest recommendations to Laura Dyrda at ldyrda@beckershealthcare.com","image":"https://assets.blubrry.com/coverart/orig/1211304-757094.jpg"},{"id":"112","title":"Becker’s Healthcare - Clinical Leadership Podcast","url":"https://feeds.blubrry.com/feeds/clinicalleadershippodcast.xml","author":"Becker's Healthcare","description":"Join our Becker's Healthcare team as we interview a variety of clinical leaders to learn best practices, share challenges and exchange ideas. Send future podcast guest recommendations to Laura Dyrda at ldyrda@beckershealthcare.com","image":"https://assets.blubrry.com/coverart/orig/1184117-851811.jpg"},{"id":"113","title":"Becker’s Healthcare -- Cardiology + Heart Surgery Podcast","url":"https://feeds.blubrry.com/feeds/cardiologypodcast.xml","author":"Becker's Healthcare","description":"Tune into The Becker's Healthcare Cardiology + Heart Surgery Podcast for conversations with great guest speakers that explore the past, present, and future of cardiology and heart surgery. Send guest recommendations to ldyrda@beckershealthcare.com","image":"https://assets.blubrry.com/coverart/orig/1184115-840147.jpg"},{"id":"114","title":"Becker’s Healthcare -- Ambulatory Surgery Centers Podcast","url":"https://feeds.blubrry.com/feeds/ambulatorysurgerycenters.xml","author":"Becker's Healthcare","description":"Becker's Healthcare Ambulatory Surgery Centers Podcast is an exciting new podcast from Becker's Healthcare which features interviews and conversations with thought leaders in ASC's on trending topics. Send recommendations to ldyrda@beckershealthcare.com","image":"https://assets.blubrry.com/coverart/orig/1184111-115138.jpg"},{"id":"115","title":"Becker’s Healthcare -- Pediatric Leadership Podcast","url":"https://feeds.blubrry.com/feeds/pediatricleadershippodcast.xml","author":"Becker's Healthcare","description":"Becker's Healthcare Pediatric Leadership Podcast is an exciting new podcast from Becker's Healthcare which features interviews and conversations with thought leaders in pediatrics on trending topics. Send recommendations to ldyrda@beckershealthcare.com","image":"https://assets.blubrry.com/coverart/orig/1184120-256793.jpg"},{"id":"116","title":"Becker’s Healthcare -- Spine and Orthopedic Podcast","url":"https://feeds.blubrry.com/feeds/spineandorthopodspodcast.xml","author":"Becker's Healthcare","description":"Becker's Healthcare Spine and Orthopedic Podcast is an exciting new podcast from Becker's Healthcare which features interviews and conversations with thought le